  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey (USGS) mapped
  approximately 336 square kilometers of the lower shoreface and inner-continental
  shelf offshore of Fire Island, New York in 2011 using interferometric sonar and
  high-resolution chirp seismic-reflection systems. These spatial data support research
  on the Quaternary evolution of the Fire Island coastal system and provide baseline
  information for research on coastal processes along southern Long Island. For more
  information about the WHCMSC Field Activity, see http://cmgds.marine.usgs.gov/fan_info.php?fan=2011-005-FA.\",\n\t\"license_title\":
